syntax = "proto3";
package fanxi;
import "BaseResponse.proto";

option java_package = "com.fanxi.service.message";
option java_outer_classname = "BocPhomResponseProto";

message BocPhomResponse {
   BaseResponse baseResponse=1;
   int32 zoneId=4;
   int32 tableIndex=5;
   string matchId=6;
   string uid=7;
   int32 card=8;
   bool isHaBai=9;
}




